const Discord = require('discord.js');
const db = require("megadb")
const prefix_db = new db.crearDB('prefix')
const messagejson = require("../../messages.json");
const emojijson = require("../../emojis.json");

module.exports = {
    nombre: "setprefix",
    alias: ["cambiarprefix"],
    run: async (client, message, args) => {

        const usernoperms = new Discord.MessageEmbed()
          .setDescription(`${messagejson.nopermissions}`)
          .setColor(`RED`)
        if (!message.member.hasPermission('MANAGE_ROLES')) return message.channel.send(usernoperms)

        const sprefix = args[0];

        const nosayprefix = new Discord.MessageEmbed()
        .setColor('RED')
        .setDescription(`${emojijson.no} Debes escribir el nuevo Prefix.`)

        if(!sprefix) return message.channel.send(nosayprefix)

        if (sprefix === "reset") { 
          prefix_db.eliminar(message.guild.id, sprefix)
      const resetedprefix = new Discord.MessageEmbed()
      .setDescription("El prefix ha sido establecido a `w!`")
      .setColor(`GREEM`)
          return message.channel.send(resetedprefix)
        }

         prefix_db.establecer(message.guild.id, sprefix)

         const yep = new Discord.MessageEmbed()
         .setDescription(`Mi nuevo prefix es :wb_rgb_console: ${sprefix} :wb_rgb_console_left:‚†Ä`)
         .setColor("GREEN")

        message.channel.send(yep)
        }
    }```

