///////////Eventos de los logs
client.on('messageDelete', async (messageDelete) => {
const logs = new db.crearDB("logs")
const db = require("megadb")
const embed = new Discord.MessageEmbed()

.setTitle("Wumpus Gamer | Logs")
.setDescription(`Mensaje eliminado \n ${messageDelete} \n Autor ${messageDelete.author.tag} \n Canal ${messageDelete.channel}`)
.setColor("RANDOM")
.setTimestamp()

const canal = await logs.obtener(messageDelete.guild.id)

client.channels.cache.get(canal).send(embed)
})
///////////////////////evento message update///////////////////////
client.on('messageUpdate', async (oldMessage, newMessage) => {
const logs = new db.crearDB("logs")
const db = require("megadb")
const embed = new Discord.MessageEmbed()

.setTitle("Wumpus Gamer | Logs")
.setDescription(`Mensaje actualizado \n Mensaje viejo ${oldMessage} \n Mensaje nuevo ${newMessage} \n Autor ${newMessage.author.tag} \n canal ${oldMessage.channel.name} `)
.setColor("RANDOM")
.setTimestamp()

const canal = await logs.obtener(newMessage.guild.id)

client.channels.cache.get(canal).send(embed)
})
///////////////////////evento messagedeletebulk///////////////////
client.on('messageDeleteBulk', async (messages, message) => {
const logs = new db.crearDB("logs")
const db = require("megadb")
const length = messages.array().length;
const canal = messages.first().channel.name;

const embed = new Discord.MessageEmbed()

.setTitle(`Wumpus Logs`)
.setDescription(messages.map(message => `${length} mensajes borrados en ${canal} por ${message.author.tag} \n **${message.content}**`))
.setColor("RANDOM")
.setTimestamp()

const Canal = await logs.obtener(messages.first().guild.id)

client.channels.cache.get(Canal).send(embed)

})
